import React, { useEffect, useState } from 'react';
import axios from 'axios';
import $ from 'jquery'

function Sup()
{
  const [getMessage, setGetMessage] = useState('');

  useEffect(()=>{
    axios.get('http://127.0.0.1:5000/picture').then(response => {
      console.log("SUCCESS", response)
      setGetMessage(response)
    }).catch(error => {
      console.log(error)
    })

  }, [])

alert(getMessage.data.message)

  return (
    <header class="App-header">
        <h1>sup</h1>
        <div>
          <img src={require(getMessage.data.message)} width="500px"></img>
        </div>
    </header>
  );
}

const test = ($('#btn').on('click', function(){
              fetch('https://i.imgur.com/MLsKJLZ.jpg')
                .then(function(data){
                  $('#progress').text("Loading");
                  return data.blob();
                })
                .then(function(img){
                  var dd = URL.createObjectURL(img);
                  $('#progress').text("");
                  $('img').attr('src', dd);
                })
            }));



export default function Bull(){
  return (
    <header>
      <div><Sup /></div>
      <button id="btn">Get Image</button>
      <img src="" alt=""  width="500px" />
      <div id="progress"></div>
      <script></script>
    </header>
    
  );

}
